import React, { useEffect } from "react";
import PropTypes from "prop-types";
import { connect } from "react-redux";
import Spinner from "../layout/Spinner";
import { getOpcens } from "../../actions/opcen";

const Opcens = ({ getOpcens, user, opcen: { opcens, loading } }) => {
  useEffect(() => {
    getOpcens(user);
  }, [getOpcens]);
  return loading ? <Spinner /> : <div>test</div>;
};

Opcens.propTypes = {
  getOpcens: PropTypes.func.isRequired,
};

const mapStateToProps = state => ({
  opcen: state.opcen,
  user: state.opcen.opcen.user,
});

export default connect(mapStateToProps, { getOpcens })(Opcens);
